message:
POSICIONAMENTO OFICIAL DO CANAL SOBRE BRASÍLIA

1) a manifestação é em frente ao QG;
2) não revide provocações. lembre-se que junto com você há muitas outras pessoas - inclusive crianças e idosos - e, em virtude do efeito manada, qualquer tipo de revide pode sair do controle;
3) não provoque e não crie confusão;
4) a área militar é o local para você se manifestar, pois garantida a sua segurança e a constitucionalidade pelo Ministério da Defesa e Forças;
5) não promova compartilhamento de imagem de pessoas com denúncias genéricas; há muita contrainformação e, portanto, você pode, sem querer, prejudicar essa pessoa;
6) toda a manifestação - pacífica como sempre fizemos - é garantida pela Constituição. Muitos podem questionar o fato da CF não estar mais sendo respeitada. Ok! Mas você continuará a respeitá-la;
7) a pressão popular é a arma dos justos e dos democráticos, a violência dos criminosos. Você não é um criminoso;
8) não saia da frente do QG ou participe de qualquer ato que não seja em frente do QG em Brasília.

Um abraço a todos.
Felipe Saldanha
